import React, { useState, useEffect } from "react";
import NavBar from "./NavBar";
import Footer from "./Footer";
import MainPage from "./MainPage";
import { Flex, styled } from "reakit";

const FlexWrapper = styled(Flex)`
  flex-direction: row;
`;

const Root = (props) => {
  return (
    <>
      <FlexWrapper>
        <NavBar></NavBar>
        <MainPage></MainPage>
        <Footer></Footer>
      </FlexWrapper>
    </>
  );
};

export default Root;
